require(["jquery", "miaps", "bootstrap"
         ], function($, miaps) {
	

  	$("#btnRun").on("click", goRun);
  	$("#btnBack").on("click", function() {window.history.back();});      	
	$("#name").focus();
	
	// 스킴명에는 _가 들어가면 안된다.(호출되지 않음)
	var _gScheme = "";
	
	function goRun() {
		miaps.cursor('iconLogin', 'wait', true);
		
		var _param = {};
		_param.name = $("#name").val();
		_param.mobile = $("#mobile").val();
		_param.email = $("#email").val();
		_param.cpn_tel = $("#cpn_tel").val();
		_param.cpn_name = $("#cpn_name").val();
		_param.cpn_addr = $("#cpn_addr").val();
		_param.cpn_zip = $("#cpn_zip").val();
		_param.cpn_fax = $("#cpn_fax").val();
		_param.department = $("#department").val();
		_param.position = $("#position").val();
		_param.base64_namecard_file = "data:image/png;base64,";
		//_param.base64_img="";  // base64_img, base64_namecard_file둘다 됨. 
		
		var config = {
			type: "savecontact",
			param: _param,
			callback: "_cb.cbRun"
		};
		miaps.mobile(config, _cb.cbRun);
	}
	
	var callback = {	
		cbRun : function (data) {
			miaps.cursor('iconLogin', 'default');
			var obj = miaps.parse(data);
			
			if (typeof obj == 'object') {
				alert(JSON.stringify(obj).replace(/,"/g, ',\n"'));
			} else if (typeof obj == 'string') {
				alert(obj);
			}
		}
	};
	window._cb = callback;
});